import './App.css';
import { Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route to="/" component={SignIn}></Route>
          <PrivateRoute to="/explore" component={ExploreJob}></PrivateRoute>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
